import React from "react"
import Nav from "react-bootstrap/Nav";
import NavItem from "./MainNav/NavItem";

const SecondaryNav = () => {
  const datas = [
    "IDR",
    "Account",
    "Search",
    <i class="fa-solid fa-bag-shopping" id="Open Cart"></i>
  ]

  return (
    <Nav className="navbar-expand-lg hidden-phone">
      {datas.map((data, i) => {
        return <NavItem data={data} key={i} />
      })}
    </Nav>

  )
}

export default SecondaryNav
